    /* OVERRIDE BOOTSTRAP -------------------------------------------- */
    /* EXTENDS */
    .btn-click-me {
      position: relative;
      margin: auto;
      padding: 19px 22px;
      transition: all .2s ease;
    }

    .btn-click-me:before {
      content: "";
      position: absolute;
      top: 0;
      left: 0;
      display: block;
      border-radius: 28px;
      background: rgba(0, 165, 180, 0.5);
      width: 56px;
      height: 56px;
      transition: all .3s ease;
    }

    .btn-click-me span {
      position: relative;
      font-size: 16px;
      line-height: 18px;
      font-weight: 900;
      letter-spacing: .25em;
      text-transform: uppercase;
      vertical-align: middle;
    }

    .btn-click-me svg {
      position: relative;
      top: 0;
      margin-left: 10px;
      fill: none;
      stroke-linecap: round;
      stroke-linejoin: round;
      stroke: #111;
      stroke-width: 2;
      transform: translateX(-5px);
      transition: all .3s ease;
    }

    .btn-click-me:hover {
      text-decoration: none;
      color: #fff;
    }

    .btn-click-me:hover:before {
      width: 100%;
      background: #00a5b4;
    }

    .btn-click-me:hover svg {
      transform: translateX(0);
      stroke: #fff;
    }

    .btn-click-me:hover:active {
      transform: scale(0.96);
    }
